#define SCREEN_WIDTH 320
#define SCREEN_HEIGHT 240
#define PIXEL_BUF_CTRL_BASE 0xFF203020
#define COLOR_BLACK 0x0000
#define RLEDs ((volatile long *)0xFF200000)

volatile int pixel_buffer_start;        // Pointer to the current drawing buffer
short int Buffer1[SCREEN_HEIGHT][512];  // Front/back buffer 1
short int Buffer2[SCREEN_HEIGHT][512];  // Front/back buffer 2

void wait_for_vsync();
void clear_screen();
void plot_pixel(int x, int y, short int color);
void plot_image_bg(int x, int y);
void plot_image_mario(int x, int y);
void fake_delay(int time);
void read_PS2_Mario();

volatile int *PS2_ptr = (int *)0xFF200100;  // PS/2 port address
int mario_x = 0;
int mario_y = 0;
int extended = 0;
int break_code = 0;

int main(void) {
  volatile int *pixel_ctrl_ptr = (int *)PIXEL_BUF_CTRL_BASE;

  // Set up double buffering:
  *(pixel_ctrl_ptr + 1) = (int)&Buffer1;  // front buffer = Buffer1
  wait_for_vsync();
  pixel_buffer_start = *pixel_ctrl_ptr;  // point to front buffer
  clear_screen();
  *(pixel_ctrl_ptr + 1) = (int)&Buffer2;  // back buffer = Buffer2
  pixel_buffer_start = *(pixel_ctrl_ptr + 1);
  clear_screen();

  volatile int *PS2_ptr = (int *)0xFF200100;  // PS/2 port addre
  while (1) {
    // keyboard control

    // --- DRAW ---
    plot_image_bg(0, 0);
    read_PS2_Mario();
    if (mario_y < 0) {
      mario_y = 240;
    }
    if (mario_y > 240) {
      mario_y = 0;
    }
    plot_image_mario(mario_x, mario_y);
    wait_for_vsync();
    pixel_buffer_start = *(pixel_ctrl_ptr + 1);
  }
  return 0;
}

void read_PS2_Mario() {
  volatile int *PS2_ptr = (int *)0xFF200100;  // PS/2 base address
  int PS2_data, RVALID;

  // Process all pending inputs
  while (1) {
    PS2_data = *PS2_ptr;
    RVALID = (PS2_data & 0x8000) >> 15;  // Check if there's valid new data
    if (!RVALID) {                       // Exit if no data is available
      break;
    }

    unsigned char code = PS2_data & 0xFF;  // Extract scan code

    // Handle special codes:
    if (code == 0xE0) {  // Extended code: next code is for an extended key
      extended = 1;
      continue;
    } else if (code == 0xF0) {  // Break code: indicates key release (we ignore
                                // movement on release)
      break_code = 1;
      continue;
    }

    // Only process if this is an extended key (for arrow keys)
    if (extended) {
      if (!break_code) {     // Key press event
        if (code == 0x75) {  // Up arrow scan code
          mario_y -= 5;      // Move Mario up by 5 units (adjust as needed)
        } else if (code == 0x72) {  // Down arrow scan code
          mario_y += 5;             // Move Mario down by 5 units
        }
      }
      // Reset the flags after processing the extended code
      extended = 0;
      break_code = 0;
    }
  }
}

void wait_for_vsync() {
  volatile int *pixel_ctrl_ptr = (int *)PIXEL_BUF_CTRL_BASE;
  *pixel_ctrl_ptr = 1;  // Trigger buffer swap.

  // Wait for swap to start
  while ((*(pixel_ctrl_ptr + 3) & 0x01) == 1) {
    // Busy-wait until swap is complete.
  }
}

void clear_screen() {
  for (int row = 0; row < SCREEN_HEIGHT; row++) {
    for (int col = 0; col < SCREEN_WIDTH; col++) {
      plot_pixel(col, row, COLOR_BLACK);
    }
  }
}
void plot_pixel(int x, int y, short int color) {
  volatile short int *pixel_addr =
      (volatile short int *)(pixel_buffer_start + (y << 10) + (x << 1));
  *pixel_addr = color;
}

