void plot_image_mario(int x, int y) {
  for (int i = 0; i < 32; i++) {
    for (int j = 0; j < 28; j++) {
      unsigned short color = mario[i * 28 + j];
      if (color != 0xDEAD)  // Skip transparent
        plot_pixel(x + j, y + i, color);
    }
  }
}

void erase_image_mario(int x, int y) {
  for (int i = 0; i < 32; i++) {
    for (int j = 0; j < 28; j++) {
      if (mario[i * 28 + j] != 0xDEAD) plot_pixel(x + j, y + i, 0);
    }
  }
}

